import {SIGN_IN} from 'redux/action_types';
import Auth from 'services/auth'


export const login = data => (dispatch)=>{
    _login.then(res=>{
        dispatch({
            type: SIGN_IN,
            payload:res
        })
    })
    .catch(err=>{

    })
}
